vijaya:["భానులఁ బదియుందొమ్మిదిటం జొప్పడి విరతులు నేర్పడ విజయమగున్\nసైనికయుత రంగాధిప సల్లాణసు భసభతనల్ సననగములతోన్\nభానులఁ బదియుందొమ్మిదిటం జొప్పడి విరతులు నేర్పడ విజయమగున్\nసైనికయుత రంగాధిప సల్లాణసు భసభతనల్ సననగములతోన్"],
